import React, { Component, useState } from "react";
import Home from "./Pages/user/Home";
import Main from "./Pages/user/Main";
import Login from "./Pages/admin/Login";
import DashBoard from "./Pages/admin/Dashboard";
import ResetPage from "./Pages/admin/ResetPage";
import Report from "./Pages/admin/Report";
import data from "./Data/informationData";
import { Switch, Route, Redirect } from "react-router-dom";

class Routers extends Component {
  render() {
    const [loginId, setLogin] = useState({
      user: "",
      password: "",
      authen: false,
    });
    const authenticate = data;
    const Hom = () => {
      return <Home />;
    };
    const Questionair = () => {
      return <Main />;
    };
    const Log = () => {
      return <Login loginId={loginId} setLogin={setLogin} />;
    };
    const Das = () => {
      return <DashBoard />;
    };
    const Reset = () => {
      return <ResetPage />;
    };
    const ReportChart = () => {
      return <Report />;
    };
    function fakeAuthen() {
      console.log("in fake");
      console.log("data", data);
      console.log("authen", authenticate[0].authen);
      if (authenticate.authen) {
        return true;
      } else {
        return true;
      }
    }

    return (
      <Switch>
        <Route exact path="/" render={Hom} />
        <Route exact path="/home" render={Hom} />
        <Route exact path="/main" render={Questionair} />
        <Route exact path="/admin" render={Log} />
        <Route exact path="/admin/login" render={Log} />
        {fakeAuthen() ? (
          <div>
            <Route exact path="/admin/dash" render={Das} />
            <Route exact path="/admin/reset" render={Reset} />
            <Route exact path="/admin/report" render={ReportChart} />
          </div>
        ) : (
          <Redirect to={{ pathname: "/admin/login" }} />
        )}
      </Switch>
    );
  }
}

export default Routers;
